INSERT INTO `ecommerce_go_accommodation` VALUES ('b3775fd1-7dfa-4150-b404-9534154486a3','36487130-3dd3-477e-a04e-9100bbc5143e','Au Lac Legend Hotel','Việt Nam','thanh-pho-ho-chi-minh','quan-3','90 Nguyễn Thị Minh Khai, Phường 6','<h3><strong>About this property</strong></h3><p>Named after Vietnam’s historical kingdom, Au Lac Legend Hotel offers cosy accommodation in central Ho Chi Minh. Surrounded by famous sites like Notre Dame Cathedral, it has free Wi-Fi and parking.  Au Lac Legend Hotel is a 10-minute walk from Ben Thanh Market and Con Rua Pond. Tan Son Nhat International Airport is a 30-minute drive from the hotel.  Air-conditioned rooms at Au Lac Legend Hotel feature wooden furnishings and private bathrooms with bathtubs. Each comes with a cable/satellite TV and minibar.  Guests can arrange interesting day trips at the tour desk or rent a bicycle to explore the area at leisure. The hotel also provides a business centre and laundry services.  Au Lac Restaurant serves a selection of Vietnamese and international dishes. Set within a small garden, the Coffee Shop provides an ideal setting to relax with a hot cup of coffee and snacks.</p>','[\"03b0bc36-c7b8-4199-b6d1-350c492a5953\", \"0e51ca28-6160-4b2f-ba65-4992b1c41cb3\", \"4ad19469-c014-487b-8619-86ecdf7d438c\", \"7f884eb3-04f4-4128-9f71-98e219359773\", \"89e931e9-d564-4baf-81bb-3074a2cad442\", \"8a1c6d3a-a703-46c5-af44-c53ec8304cde\", \"94fc37d9-1ca3-400f-9ff5-a84c2aae54d2\", \"c47c8d7a-de3a-4512-a8de-2271cb4297b9\", \"c94efa87-c5f4-4b44-8e54-69d9afd4fe7c\", \"dc1a908a-2424-4d44-9ee9-3cadef320227\"]',4,'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3919.3969427439265!2d106.69337837451728!3d10.780879459112615!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x31752f371db03a49%3A0x69d3b21063e3a42!2zS0jDgUNIIFPhuqBOIEFVIExBQyBMRUdFTkQ!5e0!3m2!1svi!2s!4v1752029520810!5m2!1svi!2s','{\"pet\": false, \"check_in\": \"\", \"check_out\": \"\", \"cancellation\": \"\", \"age_restriction\": false, \"refundable_dama